import { Link } from "react-router-dom";

function TeacherSidebar() {
    return (
        <div className='card'>
            <div className='list-group'>
                <Link to='/user-dashboard' className='list-group-item list-group-item-action'>Teacher Dashboard</Link>
                <Link to='/my-courses' className='list-group-item list-group-item-action'>My Courses</Link>
                <Link to='/favorite-courses' className='list-group-item list-group-item-action'>Add Course</Link>
                <Link to='/recommended-courses' className='list-group-item list-group-item-action'>My Users</Link>
                <Link to='/profile-settings' className='list-group-item list-group-item-action'>Profile Settings</Link>
                <Link to='/change-password' className='list-group-item list-group-item-action'>Change Password</Link>
                <Link to='/user-login' className='list-group-item list-group-item-action text-danger'>Logout</Link>
            </div>
        </div>
    );
}

export default TeacherSidebar;
